import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import cultureimg2 from "../img/hab-image-2.jpg";
import cultureimg3 from "../img/hab-image-3.jpg";

const ImageCarousel = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 0,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplaySpeed: 1000,
    autoplay: true,
    cssEase: "linear",
    fade: true, // Set fade to true for a fade transition
    arrows: false,
  };

  return (
    <Slider {...settings}>
      <div className="col radius-lg">
        <img
          src={cultureimg2}
          alt="Wow look at this"
          style={{ width: "100%", height: "211px", objectFit: "cover" }}
        />
      </div>
      <div className="col radius-lg">
        <img
          src={cultureimg3}
          alt="and this"
          style={{ width: "100%", height: "211px", objectFit: "cover" }}
        />
      </div>
      {/* Add more slides as needed */}
    </Slider>
  );
};

export default ImageCarousel;
